// actions.js
export const ADD_START_DATE = 'ADD_START_DATE';
export const ADD_END_DATE = 'ADD_END_DATE';

export const addStartDate = (startDate) => ({
  type: ADD_START_DATE,
  payload: startDate
});

export const addEndDate = (endDate) => ({
  type: ADD_END_DATE,
  payload: endDate
});
